import logo from './logo.svg';
import './App.css';
import { useState } from 'react';
import Axios from 'axios'




function App() {

  const [usernameReg, setUsernameReg] = useState("")
  const [passwordReg, setPasswordReg] = useState("")
  const [roleReg, setRoleReg] = useState("")
  const [fullnameReg, setFullNameReg] = useState("")


  const register = () => {
    console.log('Worked')
    Axios.post('http://localhost:3001/register', {
      username: usernameReg,
      password: passwordReg, 
      fullname: fullnameReg,
      role: "Admin"
    }).then((response) => {
      console.log(response)
    })
  }

  const checked = (e) => {
        console.log(e.target.value)
  }


  return (
    <div className="App">
      <div className="registration">
        <h1>Registration</h1><br></br>
        <label>Full name</label><br></br>
        <input type="text" onChange={(e) => {setFullNameReg(e.target.value)}}/><br></br>
        <label>Username</label><br></br>
        <input type="text" onChange={(e) => {setUsernameReg(e.target.value)}}/><br></br>
        <label>Password</label><br></br>
        <input type="text" onChange={(e) => {setPasswordReg(e.target.value)}}/><br></br>
        <br></br>
        <label>Role</label><br></br>
        <br></br>
        <label>Client</label>
        <input type="radio" onChange={checked} name="Role" value="Client"/><br></br>
        <label>Manager</label>
        <input type="radio" onChange={checked} name="Role" value="Manager"/><br></br>
        <button onClick={register}>Register</button><br></br>
      </div>
      <div className="login">
        <h1>Login</h1><br></br>
        <input type="text" placeholder="Username..." onChange={(e) => {setUsername(e.target.value)}}/><br></br>
        <br></br>
        <input type="password" placeholder="Password..." /><br></br>
        <br></br>
        <button>Log in</button>
      </div>
    </div>
  );
}

export default App;
